import React from "react";
import Maincontent from "../components/Maincontent";
import "../components/main.css";

function Article(props) {
  useEffect(() => {
    axios
      .get(`http://localhost:5000/api/articles/${props.match.params.id}`)
      .then((res) => [
        setVideoLink(res.data.VideoLink),
        setVideoTitle(res.data.VideoTitle),
        setVideoSummary(res.data.VideoSummary),
        setVideoPublishDate(res.data.VideoPublishDate),
      ])
      .catch((error) => console.log(error));
  }, [props]);

  return (
    <div>
      <Maincontent title={props.title} subTitle={props.subTitle} />
      <div className="articlemagestyle"></div>
      <div className="footerspace"></div>
      <div>
        <text></text>
      </div>
    </div>
  );
}

export default Article;
